// import ButtonAppBar from "@components/Header";

import React, { useEffect, useState, useRef } from "react";

import { Box, Grid, Stack, Typography } from "@mui/material";
import { DefaultCard } from "components/Card";
import LoadingScreen from "components/LoadingScreen";
import { delay } from "utils/helper";
import { FadeInWhenVisible } from "components/Animations";
import {
  animate,
  motion,
  useMotionTemplate,
  useMotionValue,
  useSpring,
  useTransform,
} from "framer-motion";
import styled from "@emotion/styled";

// ...

const RotationWrapper = styled(motion.div)`
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  transform-style: preserve-3d;
`;

export default function AccountCard() {
  const cardRef = useRef();
  // mouse position
  const mouseX = useMotionValue(
    typeof window !== "undefined" ? window.innerWidth / 2 : 0
  );
  const mouseY = useMotionValue(
    typeof window !== "undefined" ? window.innerHeight / 2 : 0
  );

  // handle mouse move on document
  useEffect(() => {
    const handleMouseMove = (e) => {
      // animate mouse x and y
      animate(mouseX, e.clientX);
      animate(mouseY, e.clientY);
    };
    if (typeof window === "undefined") return;
    // recalculate grid on resize
    window.addEventListener("mousemove", handleMouseMove);
    // cleanup
    return () => {
      window.removeEventListener("mousemove", handleMouseMove);
    };
  }, []);

  const dampen = 25;
  const rotateX = useTransform(mouseY, (newMouseY) => {
    if (!cardRef.current) return 0;
    const rect = cardRef.current.getBoundingClientRect();
    const newRotateX = newMouseY - rect.top - rect.height / 2;
    return -newRotateX / dampen;
  });
  const rotateY = useTransform(mouseX, (newMouseX) => {
    if (!cardRef.current) return 0;
    const rect = cardRef.current.getBoundingClientRect();
    const newRotateY = newMouseX - rect.left - rect.width / 2;
    return newRotateY / dampen;
  });

  const diagonalMovement = useTransform(
    [rotateX, rotateY],
    ([newRotateX, newRotateY]) => {
      const position = newRotateX + newRotateY;
      return position;
    }
  );

  const shadowPosition = useTransform([rotateY], ([newRotateY]) => {
    return newRotateY * -1;
  });

  const sheenPosition = useTransform(diagonalMovement, [-5, 5], [-100, 200]);
  const sheenOpacity = useTransform(
    sheenPosition,
    [-100, 50, 200],
    [0.05, 0.2, 0.05]
  );
  const sheenGradient = useMotionTemplate`linear-gradient(
    55deg,
    transparent,
    rgba(255 255 255 / ${sheenOpacity}) ${sheenPosition}%,
    transparent)`;
  const boxShadow = useMotionTemplate`${shadowPosition}px ${rotateX}px 6px 5px rgba(0,0,0,0.2)`;

  return (
    <RotationWrapper style={{ rotateX, rotateY }}>
      <FadeInWhenVisible>
        <DefaultCard
          innerRef={cardRef}
          style={{
            backgroundImage: sheenGradient,
            boxShadow: boxShadow,
          }}
        >
          <Box
            sx={{
              backgroundImage: "url(/doodle-background.png)",
              backgroundSize: "cover",
            }}
          >
            <Grid
              container
              sx={{
                aspectRatio: "2/1",
              }}
            >
              <Grid item xs={5} md={4} sx={{ padding: 2 }}>
                <motion.div
                  style={{
                    boxShadow: boxShadow,
                    borderRadius: 8,
                    backgroundColor: "white",
                  }}
                >
                  <img
                    style={{
                      width: "100%",
                    }}
                    src="./OPS.png"
                  />
                </motion.div>

                <Typography
                  variant={"h5"}
                  fontWeight={700}
                  fontSize={10}
                  sx={{
                    textTransform: "uppercase",
                    letterSpacing: 3,
                    color: "#294283",
                    m: 0,
                  }}
                >
                  Active Since
                </Typography>
                <Typography
                  sx={{
                    textTransform: "uppercase",
                    color: "#294283",
                  }}
                >
                  2023
                </Typography>
              </Grid>
              <Grid item xs={7} md={8}>
                <Stack
                  sx={{
                    flex: 2,
                    height: "100%",
                    padding: 2,
                  }}
                >
                  <Typography
                    variant={"h5"}
                    fontWeight={700}
                    fontSize={10}
                    sx={{
                      textTransform: "uppercase",
                      letterSpacing: 3,
                      color: "#294283",
                      m: 0,
                    }}
                  >
                    Portfolio
                  </Typography>
                  <Typography
                    sx={{
                      textTransform: "uppercase",
                      color: "#294283",
                    }}
                  >
                    Operations
                  </Typography>
                  <Typography
                    variant="h5"
                    fontWeight={700}
                    fontSize={10}
                    sx={{
                      textTransform: "uppercase",
                      letterSpacing: 3,
                      color: "#294283",
                    }}
                  >
                    Name
                  </Typography>
                  <Typography
                    sx={{
                      textTransform: "uppercase",
                      color: "#294283",
                    }}
                  >
                    Ricky Winarko
                  </Typography>
                  <Typography
                    variant="h5"
                    fontWeight={700}
                    fontSize={10}
                    sx={{
                      textTransform: "uppercase",
                      letterSpacing: 3,
                      color: "#294283",
                    }}
                  >
                    Membership
                  </Typography>
                  <Typography
                    sx={{
                      textTransform: "uppercase",
                      color: "#294283",
                    }}
                  >
                    SubCom
                  </Typography>
                </Stack>
              </Grid>
            </Grid>
            <Grid item xs={12}>
              <Typography
                fontSize={18}
                fontWeight={600}
                sx={{
                  textAlign: "right",
                  textTransform: "uppercase",
                  letterSpacing: 3,
                  color: "white",
                }}
              >
                Garage@EEE
              </Typography>
            </Grid>
          </Box>
        </DefaultCard>
      </FadeInWhenVisible>
    </RotationWrapper>
  );
}
